import "./Expenses.css";
import ExpenseItem from "../ExpenseItem/ExpenseItem";
import "../../App";
function Expenses(e) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={properties[0].title}
        amount={properties[0].amount}
        date={properties[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={properties[1].title}
        amount={properties[1].amount}
        date={properties[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={properties[2].title}
        amount={properties[2].amount}
        date={properties[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={properties[3].title}
        amount={properties[3].amount}
        date={properties[3].date}
      ></ExpenseItem>
    </div>
  );
}
export default Expenses;
